import { Component } from '@angular/core';
import { UserService } from '../../service/user.service';
import { Router } from '@angular/router';

@Component({
  selector: 'app-register',
  templateUrl: './register.component.html',
  styleUrls: ['./register.component.css']
})
export class RegisterComponent {
  registrationFormModel: any = {};
  registrationSuccess: boolean = false;

  constructor(private userService: UserService, private router: Router) { }

  registerUser() {
    this.userService.registerUser(this.registrationFormModel).subscribe(response => {
      // Handle success response
      console.log('User registered successfully:', response);
      this.registrationSuccess = true;
      this.userService.setToken(response.token)
      // Optionally, you can redirect to a success page or display a success message
    }, error => {
      // Handle error response
      console.error('Error registering user:', error);
      // Optionally, you can display an error message to the user
    });
  }

  redirectToLink(routePath: string) {
    this.router.navigateByUrl(routePath);
  }
}
<div>
    <h2>Register User</h2>
    <form (ngSubmit)="registerUser()" #registerForm="ngForm">
        <div>
            <label for="firstName">First Name </label>
            <input type="text" id="firstName" name="firstName" [(ngModel)]="registrationFormModel.firstName" required>
        </div>
        <div>
            <label for="lastName">Last Name </label>
            <input type="text" id="lastName" name="lastName" [(ngModel)]="registrationFormModel.lastName" required>
        </div>
        <div>
            <label for="email">Email </label>
            <input type="email" id="email" name="email" [(ngModel)]="registrationFormModel.email" required>
        </div>
        <div>
            <label for="password">Password </label>
            <input type="password" id="password" name="password" [(ngModel)]="registrationFormModel.password" required>
        </div>
        <button type="submit">Register</button>
        <p *ngIf="registrationSuccess">Registration successful</p>
    </form>
    <br>
    <button (click)="redirectToLink('/login')">Login Now</button>
</div>
